import FormLabel from '@material-ui/core/FormLabel';
import Radio from '@material-ui/core/Radio';

class HER2status extends Component {
    constructor(props){
    super(props);
    this.state = { 
        items: [
            { id: 1, value: "HR+ HER2+"},
            { id: 2, value: "HR+ HER2-"},
            { id: 3, value: "HR- HER2+"},
            { id: 4, value: "Triple negatief"},
        ]
    };
    };
 render(){
        return (
        <div>
            {this.state.items.map(item =>
            console.log(item.id),
                <FormControlLabel 
                    key={item.id}
                    value={item.value}
                    control={<Radio color="primary"/>}
                    label={item.Value}
                />)}
        </div>
            // <FormControlLabel
